import React from 'react';
import VectorImage from 'src/assets/images/start1_Vector.png';
import './footer.scss'

function Footer() {
    return (
        <div className='footer'>
            <div id='Email'>
                <img id='Vector' src={VectorImage} loading="lazy" alt={'Vector'} /> 
            </div>
            <div id='AboutPrivacyFaq'>
                <a type='button' href="/about">About</a><br/>
                Privacy<br/>
                FAQ<br/>
            </div>
        </div>   
    )
  }

  export default Footer;
